import style from "./Card.module.css"

export default function Card({onClose, name, status, gender, species, image}) {
   return (
      <div className={style.cont}>
         <button onClick={onClose}>X</button>
         <div>
         <h2>{name}</h2>
         <h2>{status}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <img src={image} alt={name} />
         </div>
      </div>
   );
}
